Comme je l'ai dit en story, la note que je donne a Gears 5 c'est "coussi-coussa/20". Mais pourquoi?
En sachant que je me focus sur la campagne hein, le mode Horde est toujours aussi cool, la mode fuite est pas ouf et le mode Bataille est rempli de mecs ultra chauds qui te laisse même pas faire un frag.
En gros la campagne se compose de 4 actes: le 1er et le dernier sont classiques, les actes 2 et 3 sont ouverts. C'est à dire qu'ils prennent place dans une zone ouverte avec des objectifs secondaires, des zones facultives et tout ça.
Et on va pas se mentir si les actes classiques sont tres bons, les actes ouverts sont longs, laborieux et remplis d'aller retours peu palpitant, le Skiff (le vehicule quoi) est marrant mais sans plus et au final on finis un peu par foncer vers l'objectif principal puisque la seule récompense de ces missions secondaires c'est des améliorations pour Jack le robot alors qu'en vrai on peut finir le jeu en l'utilisant genre... 3 fois.
Et là on a une belle preuve que la linéarité dans un jeu ça a du bon, parce que ne pas laisser le joueur s'éparpiller ça permet de maîtriser le rythme et la narration! Si des jeux comme The Last of Us, Uncharted ou autres sont si efficaces c'est parce qu'ils ne te laissent pas vagabonder sans raisons.
Gears 5 à tenter un truc, c'est audacieux, mais une zone ouverte dans laquelle rien de foufou ne se passe, avec des voyages longs et chiants, qui mènent à des combats facultatifs de 3 minutes, et bah c'est pas palpitant et le jeu peut vite te tomber des mains!
Ce qui est d'autant plus dommage que le jeu met en place un système de choix un peu nul mais qui est mis en place pour un choix final qui lui est vraiment important (impossible d'en parler sans spoiler) donc quitte à innover, mettez nous quelque choix coolos qui donnent envie de refaire l'aventure plutôt que des zones vides qui donnent envie de le mettre au placards.
